import React, { useState } from 'react'
import ProjectCard from './ProjectCard'

function Projects(projects) {

  const projectComponents = projects.map((eachProject) => {
    return (
      <ProjectCard 
      key = {eachProject.id}
      {...eachProject}
    />)
  })
  return (
    <div>
      <h1>Projects</h1>
      <div>{projectComponents}</div>
    </div>
  )
}

export default Projects
